import { Button } from "@mui/material";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div
      style={{ height: 80, width: "100%", display: "flex", position: "fixed" }}
    >
      <div style={{ flex: 3 }}></div>
      <div
        style={{
          flex: 4,
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          gap: 40,
        }}
      >
        <Button style={{ border: "1px solid orange" }}>
          <Link style={{ textDecoration: "none" }} to="/">
            COIN
          </Link>
        </Button>
        <Button style={{ border: "1px solid orange" }}>
          <Link style={{ textDecoration: "none" }} to="/addcoin">
            PRICE
          </Link>
        </Button>
      </div>
      <div style={{ flex: 3 }}></div>
    </div>
  );
};

export default Navbar;
